import React from 'react'

import { FlatList } from 'react-native'

import Screen from '../components/Screen'
import UserListItem from '../components/UserListItem'
import ListItemSeparator from '../components/ListItemSeparator'

import { connect } from 'react-redux'
import { getAllProfiles } from '../actions/Profile'

const users = [
  {
    id: 1,
    name: 'John Doe',
    bloodGroup: 'O+',
  },
  {
    id: 2,
    name: 'John Cena',
    bloodGroup: 'O-',
  },
  {
    id: 3,
    name: 'Bruce Wayne',
    bloodGroup: 'A+',
  },
  {
    id: 4,
    name: 'Clark Kent',
    bloodGroup: 'A-',
  },
  {
    id: 5,
    name: 'Diana Prince',
    bloodGroup: 'AB+',
  },
  {
    id: 6,
    name: 'Tony Stark',
    bloodGroup: 'AB-',
  },
  {
    id: 7,
    name: 'Steve Rogers',
    bloodGroup: 'B+',
  },
  {
    id: 8,
    name: "T'Challa",
    bloodGroup: 'B-',
  },
  {
    id: 9,
    name: 'Bucky',
    bloodGroup: 'O+',
  },
  {
    id: 10,
    name: 'Bruce Banner',
    bloodGroup: 'O-',
  },
  {
    id: 12,
    name: 'Natasha',
    bloodGroup: 'A+',
  },
  {
    id: 13,
    name: 'Berry Allan',
    bloodGroup: 'O+',
  },
]

const UsersListScreen = ({ navigation, getAllProfiles, profiles }) => {
  return (
    <Screen>
      <FlatList
        data={users}
        keyExtractor={(user) => user.id}
        renderItem={({ item }) => (
          <UserListItem
            name={item.name}
            bloodGroup={item.bloodGroup}
            onPress={() => navigation.navigate('Profile_Page')}
          />
        )}
        ItemSeparatorComponent={ListItemSeparator}
      />
    </Screen>
  )
}

export default connect(null, {getAllProfiles})(UsersListScreen)
